    </head>
    <body>
      <main class="content">
        <div class="title">
          <a class="logo" href="#">
            AJISAQ Ticketing Platform JUMM MIS
          </a>
          <nav>
            <ul class="nav__items">
              <li>
                <a href="index.html" class="active">
                  Home
                </a>
              </li>
              <li>
                <a href="facility.html">Facility</a>
              </li>
              <li>
                <a href="gate.html">Gate</a>
              </li>
            </ul>
          </nav>
          <a href="#">
            <button class="logout">Logout</button>
          </a>
          <div class="mobile__nav">
            <input id="toggle" type="checkbox" />
            <label class="hamburger" for="toggle">
              <div class="hamburger__top"></div>
              <div class="hamburger__meat"></div>
              <div class="hamburger__bottom"></div>
            </label>
            <div class="hamburger__nav">
              <div class="hamburger__nav--wrapper">
                <nav class="hamburger__nav--items">
                  <a href="#">Services</a>
                  <a href="#">Projects</a>
                  <a href="#">About</a>
                </nav>
              </div>
            </div>
          </div>
        </div>

        <div class="header">
          <h1>Jimeta Ultra Modern Market Transaction Sumarry</h1>
        </div>

        <div class="main">
          <div class="card">
            <div class="card-title">Today</div>
            <div class="card-body">
              <canvas id="today"></canvas>
            </div>
          </div>
          <div class="card">
            <div class="card-title">Yesterday</div>
            <div class="card-body">
              <canvas id="yesterday"></canvas>
            </div>
          </div>
          <div class="card">
            <div class="card-title">Last Seven (7) days</div>
            <div class="card-body">
              <canvas id="last-seven-days"></canvas>
            </div>
          </div>
          <div class="card">
            <div class="card-title">Last Thirty (30) days</div>
            <div class="card-body">
              <canvas id="last-thirty-days"></canvas>
            </div>
          </div>
        </div>
        <div class="partner"></div>
        <div class="footer">
          <p>Powered By AJISAQ LTD &copy; 2020</p>
        </div>
      </main>
      <script src="https://cdn.jsdelivr.net/npm/chart.js@2.8.0"></script>
    </body>
  </html>
);
export default Header;
